import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Videos() {
  return (
    <Container>
      <Row>
        <Col>
        <a href=' '>Add Video</a>
        </Col>
        <Col>2 of 2</Col>
      </Row>
    </Container>
  );
}

export default Videos;
